(1, 1, 'Terms and Conditions', 'WhatsApp Image 2019-12-15 at 11.27.56 AM.jpeg', '<p><span dir=\"LTR\">The&nbsp;terms&nbsp;and&nbsp;conditions&nbsp;for&nbsp;QeyeQ&nbsp;site:-</span></p>\r\n\r\n<p>The&nbsp;terms&nbsp;and&nbsp;conditions&nbsp;express&nbsp;an&nbsp;agreement&nbsp;between&nbsp;the&nbsp;client&nbsp;and&nbsp;our&nbsp;site.&nbsp;The&nbsp;terms&nbsp;and&nbsp;conditions&nbsp;page&nbsp;contains&nbsp;many&nbsp;conditions&nbsp;to&nbsp;regulate&nbsp;the&nbsp;transaction&nbsp;between&nbsp;them,&nbsp;and&nbsp;know&nbsp;the&nbsp;client&nbsp;how&nbsp;to&nbsp;use&nbsp;our&nbsp;site&nbsp;and&nbsp;how&nbsp;to&nbsp;know&nbsp;its&nbsp;terms&nbsp;to&nbsp;avoid&nbsp;violating&nbsp;those&nbsp;terms.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>First:&nbsp;General&nbsp;conditions&nbsp;for&nbsp;the&nbsp;site:-</strong></p>\r\n\r\n<p>1-&nbsp;Once&nbsp;the&nbsp;client&nbsp;starts&nbsp;the&nbsp;registration&nbsp;process&nbsp;on&nbsp;our&nbsp;site,&nbsp;it&nbsp;means&nbsp;that&nbsp;he&nbsp;has&nbsp;read&nbsp;the&nbsp;terms&nbsp;and&nbsp;conditions&nbsp;which&nbsp;are&nbsp;mentioned&nbsp;in&nbsp;the&nbsp;site.&nbsp;&nbsp;He&nbsp;is&nbsp;fully&nbsp;prepared&nbsp;to&nbsp;view&nbsp;the&nbsp;terms&nbsp;and&nbsp;conditions&nbsp;page&nbsp;from&nbsp;time&nbsp;to&nbsp;time&nbsp;to&nbsp;see&nbsp;the&nbsp;new&nbsp;terms&nbsp;that&nbsp;have&nbsp;been&nbsp;added&nbsp;to&nbsp;this&nbsp;page&nbsp;or&nbsp;any&nbsp;items&nbsp;modified&nbsp;by&nbsp;the&nbsp;site&nbsp;administration.</p>\r\n\r\n<p>2-&nbsp;Technical&nbsp;support&nbsp;is&nbsp;available&nbsp;to&nbsp;receive&nbsp;all&nbsp;client&nbsp;inquiries,&nbsp;and&nbsp;ready&nbsp;throughout&nbsp;the&nbsp;day&nbsp;to&nbsp;respond&nbsp;to&nbsp;those&nbsp;queries,&nbsp;and&nbsp;also&nbsp;ready&nbsp;to&nbsp;solve&nbsp;any&nbsp;problem&nbsp;that&nbsp;may&nbsp;occur&nbsp;to&nbsp;any&nbsp;client&nbsp;on&nbsp;our&nbsp;site.</p>\r\n\r\n<p>3-&nbsp;The&nbsp;client&nbsp;must&nbsp;acknowledge&nbsp;that&nbsp;all&nbsp;the&nbsp;data&nbsp;he&nbsp;provides&nbsp;to&nbsp;our&nbsp;site&nbsp;is&nbsp;100%&nbsp;correct.</p>\r\n\r\n<p>4-&nbsp;All&nbsp;financial&nbsp;transactions&nbsp;must&nbsp;be&nbsp;done&nbsp;within&nbsp;the&nbsp;site,&nbsp;and&nbsp;communication&nbsp;should&nbsp;be&nbsp;made&nbsp;only&nbsp;with&nbsp;customer&nbsp;service&nbsp;numbers&nbsp;on&nbsp;our&nbsp;site.&nbsp;It&nbsp;is&nbsp;strictly&nbsp;prohibited&nbsp;to&nbsp;communicate&nbsp;with&nbsp;people&nbsp;outside&nbsp;our&nbsp;site.</p>\r\n\r\n<p>5-&nbsp;The&nbsp;administration&nbsp;of&nbsp;our&nbsp;site&nbsp;requests&nbsp;all&nbsp;users&nbsp;to&nbsp;comply&nbsp;with&nbsp;the&nbsp;terms&nbsp;and&nbsp;conditions&nbsp;of&nbsp;our&nbsp;site.</p>\r\n\r\n<p>6-&nbsp;You&nbsp;can&nbsp;subscribe&nbsp;to&nbsp;our&nbsp;website&#39;s&nbsp;email&nbsp;and&nbsp;receive&nbsp;many&nbsp;special&nbsp;offers&nbsp;about&nbsp;our&nbsp;products&nbsp;by&nbsp;putting&nbsp;your&nbsp;email&nbsp;and&nbsp;clicking&nbsp;on&nbsp;the&nbsp;Subscribe&nbsp;icon.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Second:&nbsp;The&nbsp;terms&nbsp;of&nbsp;dealing&nbsp;with&nbsp;QeyeQ&nbsp;site:-</strong></p>\r\n\r\n<p>1-&nbsp;All&nbsp;clients&nbsp;must&nbsp;provide&nbsp;the&nbsp;site&nbsp;with&nbsp;all&nbsp;the&nbsp;data&nbsp;and&nbsp;information&nbsp;required&nbsp;of&nbsp;them.</p>\r\n\r\n<p>2-&nbsp;The&nbsp;site&nbsp;has&nbsp;many&nbsp;means&nbsp;of&nbsp;communication,&nbsp;and&nbsp;we&nbsp;are&nbsp;happy&nbsp;to&nbsp;communicate&nbsp;with&nbsp;us&nbsp;at&nbsp;any&nbsp;time&nbsp;in24&nbsp;hours&nbsp;a&nbsp;day.</p>\r\n\r\n<p>3-&nbsp;Our&nbsp;site&nbsp;has&nbsp;the&nbsp;right&nbsp;to&nbsp;stop&nbsp;the&nbsp;account&nbsp;of&nbsp;any&nbsp;user&nbsp;if&nbsp;he&nbsp;violates&nbsp;the&nbsp;terms&nbsp;of&nbsp;our&nbsp;site&nbsp;more&nbsp;than&nbsp;one&nbsp;time.</p>\r\n\r\n<p>4-&nbsp;If&nbsp;there&nbsp;is&nbsp;an&nbsp;error&nbsp;in&nbsp;the&nbsp;pricing&nbsp;process&nbsp;of&nbsp;one&nbsp;of&nbsp;our&nbsp;products&nbsp;which&nbsp;existed&nbsp;on&nbsp;our&nbsp;site.&nbsp;Our&nbsp;site&nbsp;will&nbsp;send&nbsp;a&nbsp;notification&nbsp;to&nbsp;the&nbsp;clients&nbsp;to&nbsp;explain&nbsp;this&nbsp;error&nbsp;for&nbsp;them&nbsp;and&nbsp;correct&nbsp;it.&nbsp;Our&nbsp;site&nbsp;has&nbsp;the&nbsp;full&nbsp;right&nbsp;to&nbsp;correct&nbsp;this&nbsp;error&nbsp;in&nbsp;pricing&nbsp;even&nbsp;if&nbsp;the&nbsp;client&nbsp;buys&nbsp;this&nbsp;product&nbsp;and&nbsp;is&nbsp;on&nbsp;its&nbsp;way&nbsp;to&nbsp;ship&nbsp;to&nbsp;the&nbsp;client.</p>\r\n\r\n<p>6-&nbsp;If&nbsp;there&nbsp;is&nbsp;a&nbsp;dispute&nbsp;with&nbsp;a&nbsp;client,&nbsp;all&nbsp;parties&nbsp;are&nbsp;obliged&nbsp;to&nbsp;work&nbsp;on&nbsp;solving&nbsp;that&nbsp;problem&nbsp;and&nbsp;we&nbsp;have&nbsp;set&nbsp;a&nbsp;30&nbsp;day&nbsp;deadline&nbsp;to&nbsp;solve&nbsp;that&nbsp;problem.&nbsp;If&nbsp;that&nbsp;problem&nbsp;is&nbsp;not&nbsp;resolved,&nbsp;the&nbsp;affected&nbsp;party&nbsp;will&nbsp;go&nbsp;to&nbsp;the&nbsp;Saudi&nbsp;courts&nbsp;to&nbsp;solve&nbsp;that&nbsp;problem.</p>\r\n\r\n<p>6-&nbsp;The&nbsp;site&nbsp;has&nbsp;the&nbsp;full&nbsp;right&nbsp;to&nbsp;accept&nbsp;or&nbsp;reject&nbsp;any&nbsp;order&nbsp;without&nbsp;giving&nbsp;any&nbsp;reasons.</p>\r\n\r\n<p>7-&nbsp;Our&nbsp;site&nbsp;will&nbsp;disclaim&nbsp;from&nbsp;any&nbsp;responsibility&nbsp;if&nbsp;one&nbsp;of&nbsp;the&nbsp;clients&nbsp;is&nbsp;damaged&nbsp;due&nbsp;to&nbsp;the&nbsp;failure&nbsp;of&nbsp;the&nbsp;site&nbsp;and&nbsp;we&nbsp;could&nbsp;not&nbsp;stop&nbsp;this&nbsp;failure&nbsp;at&nbsp;that&nbsp;time.&nbsp;Our&nbsp;site&nbsp;is&nbsp;keen&nbsp;not&nbsp;to&nbsp;cause&nbsp;any&nbsp;malfunction&nbsp;or&nbsp;stop&nbsp;to&nbsp;our&nbsp;site.</p>\r\n\r\n<p>8-&nbsp;The&nbsp;copyrights&nbsp;of&nbsp;our&nbsp;site:</p>\r\n\r\n<p>Everything&nbsp;or&nbsp;services&nbsp;or&nbsp;content&nbsp;within&nbsp;QeyeQ&nbsp;site&nbsp;is&nbsp;belonging&nbsp;to&nbsp;our&nbsp;site&nbsp;and&nbsp;no&nbsp;person&nbsp;or&nbsp;institution,&nbsp;or&nbsp;website&nbsp;or&nbsp;application&nbsp;or&nbsp;company&nbsp;may&nbsp;use&nbsp;or&nbsp;reuse&nbsp;or&nbsp;copy&nbsp;or&nbsp;paste&nbsp;anything&nbsp;belongs&nbsp;to&nbsp;our&nbsp;site.&nbsp;Any&nbsp;person&nbsp;does&nbsp;this;&nbsp;he&nbsp;will&nbsp;expose&nbsp;himself&nbsp;or&nbsp;his&nbsp;company&nbsp;or&nbsp;his&nbsp;institution&nbsp;or&nbsp;his&nbsp;site&nbsp;or&nbsp;his&nbsp;application&nbsp;for&nbsp;accountability&nbsp;and&nbsp;prosecution&nbsp;by&nbsp;QeyeQ&nbsp;administration</p>', 1, '2019-01-08', 1, NULL, '2020-01-27 10:11:16', '2020-01-27 10:11:16'),
(2, 1, 'About QeyQ', 'WhatsApp Image 2019-12-15 at 11.27.56 AM.jpeg', '<p><strong><span dir=\"LTR\">About&nbsp;us:-</span></strong></p>\r\n\r\n<p><span dir=\"LTR\">Each&nbsp;of&nbsp;us&nbsp;likes&nbsp;to&nbsp;appear&nbsp;in&nbsp;front&nbsp;of&nbsp;his&nbsp;friends&nbsp;in&nbsp;full&nbsp;elegance,&nbsp;and&nbsp;in&nbsp;order&nbsp;to&nbsp;get&nbsp;it&nbsp;you&nbsp;should&nbsp;own&nbsp;beautiful&nbsp;glasses&nbsp;that&nbsp;distinguish&nbsp;you&nbsp;and&nbsp;highlight&nbsp;the&nbsp;beauty&nbsp;of&nbsp;your&nbsp;eyes&nbsp;in&nbsp;front&nbsp;of&nbsp;others.&nbsp;QeyeQ&nbsp;site&nbsp;specializes&nbsp;in&nbsp;making&nbsp;all&nbsp;kinds&nbsp;of&nbsp;glasses&nbsp;with&nbsp;great&nbsp;appearance&nbsp;and&nbsp;distinctive&nbsp;design.&nbsp;&nbsp;With&nbsp;QeyeQ&nbsp;glasses&nbsp;Madam,&nbsp;your&nbsp;eyes&nbsp;will&nbsp;become&nbsp;like&nbsp;the&nbsp;eyes&nbsp;of&nbsp;the&nbsp;queens&nbsp;and&nbsp;your&nbsp;elegance&nbsp;like&nbsp;the&nbsp;elegance&nbsp;of&nbsp;the&nbsp;most&nbsp;beautiful&nbsp;princesses,&nbsp;with&nbsp;QeyeQ&nbsp;glasses&nbsp;sir,&nbsp;your&nbsp;eyes&nbsp;will&nbsp;become&nbsp;like&nbsp;the&nbsp;eyes&nbsp;of&nbsp;the&nbsp;most&nbsp;beautiful&nbsp;artists&nbsp;and&nbsp;your&nbsp;elegance&nbsp;is&nbsp;more&nbsp;beautiful&nbsp;than&nbsp;them.&nbsp;We&nbsp;have&nbsp;a&nbsp;group&nbsp;of&nbsp;skilled&nbsp;employees&nbsp;who&nbsp;are&nbsp;specialized&nbsp;in&nbsp;making&nbsp;the&nbsp;best&nbsp;types&nbsp;of&nbsp;glasses.&nbsp;We&nbsp;guarantee&nbsp;to&nbsp;our&nbsp;dear&nbsp;clients&nbsp;that&nbsp;our&nbsp;products&nbsp;are&nbsp;100%&nbsp;original&nbsp;and&nbsp;non-imitated.&nbsp;&nbsp;We&nbsp;are&nbsp;able&nbsp;to&nbsp;do&nbsp;all&nbsp;kinds&nbsp;of&nbsp;glasses&nbsp;only&nbsp;you&nbsp;come&nbsp;to&nbsp;us&nbsp;to&nbsp;make&nbsp;us&nbsp;take&nbsp;the&nbsp;sizes&nbsp;and&nbsp;then&nbsp;we&nbsp;do&nbsp;it&nbsp;for&nbsp;you&nbsp;and&nbsp;deliver&nbsp;it&nbsp;to&nbsp;you&nbsp;through&nbsp;the&nbsp;shipping&nbsp;service.&nbsp;We&nbsp;take&nbsp;care&nbsp;to&nbsp;satisfy&nbsp;the&nbsp;clients&nbsp;about&nbsp;our&nbsp;products,&nbsp;because&nbsp;we&nbsp;want&nbsp;to&nbsp;build&nbsp;a&nbsp;strong&nbsp;relationship&nbsp;with&nbsp;the&nbsp;dear&nbsp;clients&nbsp;last&nbsp;for&nbsp;life.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span dir=\"LTR\">Our&nbsp;objectives:-</span></strong></p>\r\n\r\n<p>QeyeQ&nbsp;has&nbsp;set&nbsp;several&nbsp;objectives&nbsp;and&nbsp;our&nbsp;site&nbsp;seeks&nbsp;in&nbsp;all&nbsp;ways&nbsp;to&nbsp;achieve&nbsp;those&nbsp;goals.&nbsp;Those&nbsp;goals&nbsp;are&nbsp;represented&nbsp;in&nbsp;the&nbsp;following&nbsp;points<span dir=\"RTL\">:</span>-</p>\r\n\r\n<p><span dir=\"RTL\">1</span>-&nbsp;Offering&nbsp;the&nbsp;best&nbsp;high&nbsp;quality&nbsp;glasses&nbsp;at&nbsp;suitable&nbsp;prices<span dir=\"RTL\">.</span></p>\r\n\r\n<p><span dir=\"RTL\">2&nbsp;</span>-&nbsp;Designing&nbsp;and&nbsp;carrying&nbsp;out&nbsp;medical&nbsp;glasses&nbsp;that&nbsp;exceed&nbsp;clients&nbsp;expectations<span dir=\"RTL\">.</span></p>\r\n\r\n<p>3-&nbsp;Provide&nbsp;the&nbsp;best&nbsp;glasses&nbsp;to&nbsp;the&nbsp;clients&nbsp;to&nbsp;serve&nbsp;as&nbsp;the&nbsp;best&nbsp;gifts&nbsp;for&nbsp;their&nbsp;friends&nbsp;and&nbsp;lovers<span dir=\"RTL\">.</span></p>\r\n\r\n<p>4-&nbsp;Committing&nbsp;to&nbsp;the&nbsp;best&nbsp;standards&nbsp;in&nbsp;the&nbsp;industry&nbsp;when&nbsp;we&nbsp;carrying&nbsp;out&nbsp;our&nbsp;high-end&nbsp;glasses.</p>', 1, '2019-01-08', 1, NULL, '2020-01-27 10:12:55', '2020-01-27 10:12:55'),
(3, 1, 'Replacement and refund policy', 'WhatsApp Image 2019-12-15 at 11.27.56 AM.jpeg', '<p>The&nbsp;process&nbsp;of&nbsp;replacement&nbsp;and&nbsp;refund&nbsp;is&nbsp;done&nbsp;very&nbsp;easily&nbsp;on&nbsp;our&nbsp;site.&nbsp;We&nbsp;are&nbsp;keen&nbsp;to&nbsp;obtain&nbsp;the&nbsp;satisfaction&nbsp;of&nbsp;the&nbsp;clients.&nbsp;There&nbsp;are&nbsp;cases&nbsp;of&nbsp;requesting&nbsp;the&nbsp;replacement&nbsp;or&nbsp;refund&nbsp;process&nbsp;which&nbsp;are:&nbsp;-</p>\r\n\r\n<p>1-&nbsp;The&nbsp;client&#39;s&nbsp;desire&nbsp;to&nbsp;replace&nbsp;one&nbsp;product&nbsp;with&nbsp;another&nbsp;one&nbsp;with&nbsp;a&nbsp;condition&nbsp;that&nbsp;this&nbsp;process&nbsp;should&nbsp;be&nbsp;done&nbsp;within&nbsp;15&nbsp;days&nbsp;of&nbsp;the&nbsp;time&nbsp;of&nbsp;purchase&nbsp;and&nbsp;the&nbsp;client&nbsp;should&nbsp;not&nbsp;use&nbsp;the&nbsp;purchased&nbsp;product.&nbsp;The&nbsp;client&nbsp;should&nbsp;explain&nbsp;to&nbsp;us&nbsp;why&nbsp;he&nbsp;wants&nbsp;to&nbsp;do&nbsp;the&nbsp;refund&nbsp;process&nbsp;to&nbsp;this&nbsp;product.</p>\r\n\r\n<p>2-&nbsp;The&nbsp;product&nbsp;is&nbsp;refunded&nbsp;due&nbsp;to&nbsp;damage&nbsp;to&nbsp;the&nbsp;product&nbsp;during&nbsp;the&nbsp;process&nbsp;of&nbsp;shipping&nbsp;and&nbsp;delivery.</p>\r\n\r\n<p>3-The&nbsp;purchase&nbsp;must&nbsp;be&nbsp;confirmed&nbsp;by&nbsp;clarifying&nbsp;the&nbsp;order&nbsp;number&nbsp;and&nbsp;invoice.</p>\r\n\r\n<p>4-&nbsp;We&nbsp;will&nbsp;not&nbsp;accept&nbsp;the&nbsp;replacement&nbsp;or&nbsp;refund&nbsp;of&nbsp;any&nbsp;product&nbsp;proven&nbsp;to&nbsp;be&nbsp;used&nbsp;by&nbsp;the&nbsp;client.</p>\r\n\r\n<p>5-&nbsp;The&nbsp;clients&nbsp;can&nbsp;request&nbsp;a&nbsp;replacement&nbsp;and&nbsp;refund&nbsp;process&nbsp;for&nbsp;a&nbsp;product&nbsp;because&nbsp;of&nbsp;an&nbsp;industry&nbsp;defect&nbsp;in&nbsp;this&nbsp;product.</p>\r\n\r\n<p>6-&nbsp;When&nbsp;the&nbsp;client&nbsp;request&nbsp;replacement&nbsp;for&nbsp;a&nbsp;specific&nbsp;product,&nbsp;the&nbsp;client&nbsp;will&nbsp;bear&nbsp;the&nbsp;cost&nbsp;of&nbsp;shipping,&nbsp;but&nbsp;in&nbsp;the&nbsp;case&nbsp;of&nbsp;the&nbsp;error&nbsp;was&nbsp;from&nbsp;the&nbsp;site&nbsp;whether&nbsp;sending&nbsp;a&nbsp;wrong&nbsp;product&nbsp;or&nbsp;a&nbsp;product&nbsp;with&nbsp;a&nbsp;price&nbsp;error&nbsp;or&nbsp;a&nbsp;product&nbsp;with&nbsp;defect&nbsp;in&nbsp;the&nbsp;industry.&nbsp;The&nbsp;site&nbsp;will&nbsp;bear&nbsp;the&nbsp;cost&nbsp;of&nbsp;shipping.</p>\r\n\r\n<p>7-&nbsp;When&nbsp;you&nbsp;request&nbsp;a&nbsp;refund&nbsp;of&nbsp;a&nbsp;product&nbsp;and&nbsp;this&nbsp;product&nbsp;is&nbsp;purchased&nbsp;through&nbsp;Visa,&nbsp;the&nbsp;amount&nbsp;paid&nbsp;by&nbsp;the&nbsp;client&nbsp;will&nbsp;reach&nbsp;the&nbsp;client&nbsp;balance&nbsp;within&nbsp;20&nbsp;to&nbsp;30&nbsp;days.</p>\r\n\r\n<p>8-&nbsp;Products&nbsp;that&nbsp;are&nbsp;discounted&nbsp;or&nbsp;have&nbsp;offers&nbsp;upon&nbsp;it,&nbsp;it&nbsp;cannot&nbsp;be&nbsp;exchanged&nbsp;or&nbsp;refunded.</p>', 1, '2019-01-08', 1, NULL, '2020-01-27 10:14:53', '2020-01-27 10:14:53'),
(4, 1, 'Payment policy:-', 'WhatsApp Image 2019-12-15 at 11.27.56 AM.jpeg', '<p>Our&nbsp;site&nbsp;provides&nbsp;in&nbsp;the&nbsp;near&nbsp;future&nbsp;many&nbsp;means&nbsp;of&nbsp;payment&nbsp;in&nbsp;order&nbsp;to&nbsp;choose&nbsp;the&nbsp;clients&nbsp;the&nbsp;appropriate&nbsp;way&nbsp;of&nbsp;payment&nbsp;for&nbsp;them&nbsp;and&nbsp;purchases&nbsp;by&nbsp;them.&nbsp;The&nbsp;payment&nbsp;process&nbsp;is&nbsp;so&nbsp;easy&nbsp;in&nbsp;our&nbsp;site.&nbsp;We&nbsp;request&nbsp;from&nbsp;the&nbsp;client&nbsp;to&nbsp;browse&nbsp;and&nbsp;see&nbsp;our&nbsp;products&nbsp;which&nbsp;is&nbsp;displayed&nbsp;on&nbsp;our&nbsp;site&nbsp;and&nbsp;chooses&nbsp;what&nbsp;he&nbsp;wants&nbsp;from&nbsp;them.&nbsp;Then,&nbsp;he&nbsp;clicks&nbsp;on&nbsp;the&nbsp;product&nbsp;that&nbsp;he&nbsp;wants&nbsp;and&nbsp;puts&nbsp;it&nbsp;in&nbsp;a&nbsp;basket&nbsp;of&nbsp;Purchases,&nbsp;and&nbsp;after&nbsp;the&nbsp;selection&nbsp;process.&nbsp;We&nbsp;will&nbsp;convert&nbsp;the&nbsp;purchase&nbsp;basket&nbsp;to&nbsp;the&nbsp;order&nbsp;page&nbsp;for&nbsp;the&nbsp;client&nbsp;to&nbsp;fill&nbsp;out&nbsp;the&nbsp;purchase&nbsp;form&nbsp;and&nbsp;put&nbsp;all&nbsp;the&nbsp;required&nbsp;data&nbsp;from&nbsp;him&nbsp;in&nbsp;this&nbsp;page,&nbsp;and&nbsp;then&nbsp;the&nbsp;payment&nbsp;process&nbsp;is&nbsp;confirmed.&nbsp;We&nbsp;will&nbsp;prepare&nbsp;the&nbsp;order&nbsp;for&nbsp;the&nbsp;client&nbsp;and&nbsp;ship&nbsp;the&nbsp;purchased&nbsp;product&nbsp;to&nbsp;the&nbsp;place&nbsp;the&nbsp;client&nbsp;wants,&nbsp;and&nbsp;the&nbsp;client&nbsp;can&nbsp;Payment&nbsp;upon&nbsp;receipt&nbsp;of&nbsp;the&nbsp;products&nbsp;purchased&nbsp;from&nbsp;us.&nbsp;Our&nbsp;site&nbsp;follows&nbsp;a&nbsp;strict&nbsp;policy&nbsp;in&nbsp;maintaining&nbsp;the&nbsp;payment&nbsp;methods&nbsp;of&nbsp;the&nbsp;clients&nbsp;(Visa&nbsp;and&nbsp;MasterCard)&nbsp;so&nbsp;that&nbsp;the&nbsp;data&nbsp;of&nbsp;these&nbsp;means&nbsp;is&nbsp;completely&nbsp;safe&nbsp;on&nbsp;our&nbsp;site.</p>', 1, '2019-01-08', 1, NULL, '2020-01-27 10:39:35', '2020-01-27 10:39:35'),
(5, 1, 'Shipping policy', 'WhatsApp Image 2019-12-15 at 11.27.56 AM.jpeg', '<p>In&nbsp;order&nbsp;to&nbsp;ensure&nbsp;the&nbsp;convenience&nbsp;of&nbsp;our&nbsp;clients,&nbsp;our&nbsp;site&nbsp;has&nbsp;contracted&nbsp;and&nbsp;agreed&nbsp;with&nbsp;one&nbsp;of&nbsp;the&nbsp;major&nbsp;shipping&nbsp;companies&nbsp;Aramex&nbsp;in&nbsp;order&nbsp;to&nbsp;deliver&nbsp;the&nbsp;products&nbsp;purchased&nbsp;by&nbsp;the&nbsp;client&nbsp;to&nbsp;the&nbsp;place&nbsp;they&nbsp;want&nbsp;as&nbsp;soon&nbsp;as&nbsp;possible,&nbsp;with&nbsp;the&nbsp;ability&nbsp;of&nbsp;the&nbsp;client&nbsp;to&nbsp;follow&nbsp;the&nbsp;shipping&nbsp;process&nbsp;through&nbsp;our&nbsp;site.&nbsp;When&nbsp;the&nbsp;client&nbsp;requests&nbsp;the&nbsp;shipping&nbsp;services,&nbsp;he&nbsp;should&nbsp;note&nbsp;that:-</p>\r\n\r\n<p>1-&nbsp;When&nbsp;you&nbsp;request&nbsp;payment&nbsp;service&nbsp;upon&nbsp;receipt,&nbsp;you&nbsp;will&nbsp;pay&nbsp;a&nbsp;fee&nbsp;from&nbsp;the&nbsp;service&nbsp;provider&nbsp;(Aramex)&nbsp;because&nbsp;Aramex&nbsp;has&nbsp;set&nbsp;a&nbsp;fixed&nbsp;amount&nbsp;to&nbsp;perform&nbsp;this&nbsp;service.&nbsp;&nbsp;This&nbsp;cost&nbsp;varies&nbsp;from&nbsp;city&nbsp;to&nbsp;city&nbsp;within&nbsp;the&nbsp;country,&nbsp;and&nbsp;this&nbsp;cost&nbsp;may&nbsp;be&nbsp;increased&nbsp;at&nbsp;any&nbsp;time&nbsp;according&nbsp;to&nbsp;Aramex&nbsp;Company.</p>\r\n\r\n<p>2-&nbsp;The&nbsp;cost&nbsp;of&nbsp;shipping&nbsp;varies&nbsp;from&nbsp;country&nbsp;to&nbsp;country&nbsp;and&nbsp;varies&nbsp;from&nbsp;city&nbsp;to&nbsp;city&nbsp;within&nbsp;the&nbsp;country.</p>\r\n\r\n<p>3-&nbsp;The&nbsp;service&nbsp;of&nbsp;shipping&nbsp;products&nbsp;to&nbsp;clients&nbsp;is&nbsp;carried&nbsp;out&nbsp;within&nbsp;a&nbsp;period&nbsp;of&nbsp;3&nbsp;to&nbsp;5&nbsp;working&nbsp;days,&nbsp;and&nbsp;it&nbsp;is&nbsp;possible&nbsp;to&nbsp;increase&nbsp;this&nbsp;period&nbsp;in&nbsp;case&nbsp;of&nbsp;requesting&nbsp;medical&nbsp;glasses&nbsp;for&nbsp;you&nbsp;with&nbsp;certain&nbsp;prescriptions,&nbsp;because&nbsp;it&nbsp;needs&nbsp;more&nbsp;time&nbsp;for&nbsp;us&nbsp;to&nbsp;carry&nbsp;out&nbsp;this&nbsp;order.</p>', 1, '2019-01-08', 1, NULL, '2020-01-27 10:40:46', '2020-01-27 10:40:46');
