(2, 2, 'lenses', 22, '{\"description\":\"<p>FreshLook&nbsp;One&nbsp;Day&nbsp;contact&nbsp;lenses,&nbsp;from&nbsp;leading&nbsp;optical&nbsp;specialists&nbsp;Ciba&nbsp;Vision,&nbsp;are&nbsp;daily&nbsp;coloured&nbsp;contact&nbsp;lenses&nbsp;that&nbsp;offer&nbsp;a&nbsp;range&nbsp;of&nbsp;shades&nbsp;to&nbsp;complement&nbsp;and&nbsp;enhance&nbsp;your&nbsp;natural&nbsp;eye&nbsp;colour.&nbsp;These&nbsp;daily&nbsp;disposable&nbsp;coloured&nbsp;contact&nbsp;lenses&nbsp;are&nbsp;available&nbsp;for&nbsp;both&nbsp;cosmetic&nbsp;or&nbsp;prescription&nbsp;use,&nbsp;simply&nbsp;select&nbsp;your&nbsp;tint&nbsp;and&nbsp;then,&nbsp;if&nbsp;you&nbsp;don&rsquo;t&nbsp;need&nbsp;sight&nbsp;correction,&nbsp;select&nbsp;0.00&nbsp;as&nbsp;your&nbsp;power.<\\/p>\",\"max_count\":1,\"image\":\"8bb286b3217ff24157f1dd899a652049.jpg\",\"type\":\"lenses\",\"right_size\":null,\"left_size\":null,\"right_cylinder\":null,\"left_cylinder\":null,\"right_axis\":null,\"left_axis\":null,\"auto_reorder\":null,\"color\":{\"color\":\"#5c5c5c\"},\"color_name\":\"Gray\",\"package\":null,\"currency\":\"sar\"}', 1, 210.00, '2019-11-24 08:00:17', '2019-11-24 08:00:17'),
