(7, 3, 'lenses', 11, '{\"description\":\"<p>Dailies&nbsp;AquaComfort&nbsp;Plus&nbsp;Toric&nbsp;are&nbsp;designed&nbsp;specifically&nbsp;to&nbsp;be&nbsp;worn&nbsp;by&nbsp;astigmatism&nbsp;patients,&nbsp;and&nbsp;so&nbsp;are&nbsp;of&nbsp;an&nbsp;elongated&nbsp;shape&nbsp;that&nbsp;ensures&nbsp;consistently&nbsp;clear&nbsp;vision.&nbsp;They&nbsp;also&nbsp;make&nbsp;use&nbsp;of&nbsp;Alcon&rsquo;s&nbsp;Lightstream&nbsp;Technology&trade;&nbsp;for&nbsp;a&nbsp;lens&nbsp;surface&nbsp;that&nbsp;is&nbsp;perfectly&nbsp;smooth&nbsp;and&nbsp;sits&nbsp;on&nbsp;your&nbsp;eye&nbsp;securely&nbsp;and&nbsp;comfortably.&nbsp;Blink-activated&nbsp;technology&nbsp;also&nbsp;causes&nbsp;moisture&nbsp;to&nbsp;be&nbsp;slowly&nbsp;released&nbsp;into&nbsp;the&nbsp;eye&nbsp;with&nbsp;each&nbsp;blink,&nbsp;keeping&nbsp;your&nbsp;eyes&nbsp;feeling&nbsp;fresh&nbsp;and&nbsp;hydrated&nbsp;all&nbsp;day.<\\/p>\",\"max_count\":100,\"image\":\"36ecd499480fe59a036c7dc21fa43201.jpg\",\"type\":\"lenses\",\"right_size\":\"-4,00\",\"left_size\":null,\"right_cylinder\":\"-0,75\",\"left_cylinder\":null,\"right_axis\":\"180\\u00b0\",\"left_axis\":null,\"auto_reorder\":null,\"color\":null,\"color_name\":null,\"package\":null,\"currency\":\"sar\"}', 1, 200.00, '2019-11-30 20:06:19', '2019-11-30 20:06:19'),
