(92, 54, 'lenses', 38, '{\"description\":\"<p><strong>Bella&nbsp;Natural&nbsp;Monthly&nbsp;Colored&nbsp;Contact&nbsp;Lenses<\\/strong><\\/p>\\r\\n\\r\\n<p><strong>It&nbsp;is&nbsp;characterized&nbsp;by&nbsp;its&nbsp;elegant&nbsp;colors&nbsp;and&nbsp;a&nbsp;thin&nbsp;circular&nbsp;ring&nbsp;that&nbsp;gives&nbsp;<\\/strong><\\/p>\\r\\n\\r\\n<p><strong>a&nbsp;wonderful&nbsp;and&nbsp;natural&nbsp;look&nbsp;to&nbsp;the&nbsp;eyes<\\/strong><\\/p>\\r\\n\\r\\n<p><strong>Shine&nbsp;with&nbsp;Bella&nbsp;Natural&nbsp;3D&nbsp;to&nbsp;give&nbsp;you&nbsp;complete&nbsp;confidence&nbsp;to&nbsp;look&nbsp;great<\\/strong><\\/p>\\r\\n\\r\\n<p><strong>Enjoy&nbsp;many&nbsp;colors(&nbsp;Cool&nbsp;Hazel,&nbsp;Cool&nbsp;Gray,&nbsp;Cool&nbsp;Blue,&nbsp;Green&nbsp;Yellow,&nbsp;Viola&nbsp;Gray)<\\/strong><\\/p>\\r\\n\\r\\n<p><strong>Choose&nbsp;the&nbsp;right&nbsp;color&nbsp;and&nbsp;size&nbsp;if&nbsp;you&nbsp;are&nbsp;looking&nbsp;for&nbsp;a&nbsp;vision&nbsp;correction<\\/strong><\\/p>\\r\\n\\r\\n<p><strong>&nbsp;&nbsp;Free&nbsp;solution&nbsp;with&nbsp;lens<\\/strong><\\/p>\",\"max_count\":100,\"image\":\"cd41099b3d414b8a4180517d7eb039b3.jpg\",\"type\":\"lenses\",\"right_size\":null,\"left_size\":null,\"right_cylinder\":null,\"left_cylinder\":null,\"right_axis\":null,\"left_axis\":null,\"auto_reorder\":null,\"color\":{\"color\":\"#5c9bbc\"},\"color_name\":\"Gray Blue\",\"package\":null,\"currency\":\"EGP\"}', 1, 350.00, '2020-01-13 18:53:54', '2020-01-13 18:53:54'),
(93, 55, 'lenses', 16, '{\"description\":\"<p>Dailies&nbsp;Aquacomfort&nbsp;plus&nbsp;are&nbsp;high&nbsp;quality&nbsp;lenses&nbsp;from&nbsp;Alcon.&nbsp;Blink&nbsp;activated&nbsp;technology&nbsp;keeps&nbsp;your&nbsp;eyes&nbsp;from&nbsp;drying&nbsp;out&nbsp;for&nbsp;up&nbsp;to&nbsp;12&nbsp;hours&nbsp;a&nbsp;day,&nbsp;even&nbsp;in&nbsp;air&nbsp;conditioned&nbsp;or&nbsp;heated&nbsp;environments.&nbsp;When&nbsp;coupled&nbsp;with&nbsp;the&nbsp;ultra-thin&nbsp;design&nbsp;of&nbsp;each&nbsp;lens,&nbsp;it&rsquo;s&nbsp;this&nbsp;technology&nbsp;that&nbsp;makes&nbsp;Aquacomfort&nbsp;plus&nbsp;so&nbsp;comfortable&nbsp;and&nbsp;easy&nbsp;to&nbsp;wear.<\\/p>\",\"max_count\":30,\"image\":\"07e9ce3ba2bfb6e3981be83a0d3711ad.jpg\",\"type\":\"lenses\",\"right_size\":\"-5,00\",\"left_size\":null,\"right_cylinder\":null,\"left_cylinder\":null,\"right_axis\":null,\"left_axis\":null,\"auto_reorder\":null,\"color\":null,\"color_name\":null,\"package\":90,\"currency\":\"SAR\"}', 1, 400.00, '2020-01-14 08:04:09', '2020-01-14 08:04:09'),
