(11, '2019-11-22 12:31:37', '2019-11-24 09:30:50', NULL, 6, 1, 'ACUVUE OASYS  HYDRACLEAR  PLUS', '<p>Acuvue&nbsp;Oasys&nbsp;lenses&nbsp;are&nbsp;designed&nbsp;to&nbsp;provide&nbsp;one&nbsp;of&nbsp;the&nbsp;most&nbsp;convenient&nbsp;any&nbsp;contact&nbsp;lenses&nbsp;Benefits&nbsp;of&nbsp;Acuvue&nbsp;Oasys&nbsp;contact&nbsp;lenses&nbsp;&bull;&nbsp;Great&nbsp;for&nbsp;those&nbsp;who&nbsp;might&nbsp;usually&nbsp;suffer&nbsp;with&nbsp;dry&nbsp;eyes&nbsp;&bull;&nbsp;Hydraclear&reg;&nbsp;Plus&nbsp;technology&nbsp;keeps&nbsp;your&nbsp;eyes&nbsp;moist&nbsp;throughout&nbsp;the&nbsp;day&nbsp;&bull;&nbsp;Smartshield&nbsp;removes&nbsp;any&nbsp;build&nbsp;up&nbsp;that&nbsp;might&nbsp;cause&nbsp;irritation&nbsp;in&nbsp;your&nbsp;eyes&nbsp;&bull;&nbsp;In&nbsp;built&nbsp;UV&nbsp;protection&nbsp;helps&nbsp;to&nbsp;keep&nbsp;your&nbsp;eyes&nbsp;health</p>', NULL, 'ACUVUE OASYS HYDRACLEAR  PLUS  Transparent contact lenses', 'ACUVUE OASYS HYDRACLEAR  PLUS  Transparent contact lenses\r\nContact lenses are used for a week Johnson & Johnson\r\nGet it now from the store QeyeQ.com  The first store to sell contact lenses in Egypt and Saudi Arabia', NULL),
(12, '2019-11-22 12:31:37', '2019-12-20 07:52:12', NULL, 6, 2, 'أكيوفيو أويسيس هيدرا كلير بلس', '<p>أكيو&nbsp;فيو&nbsp;أويسيس&nbsp;هيدرا&nbsp;كلير&nbsp;بلس&nbsp;عدسات&nbsp;لاصقة&nbsp;صنعت&nbsp;من&nbsp;شركة&nbsp;جونسون&nbsp;تعد&nbsp;من&nbsp;افضل&nbsp;</p>\r\n\r\n<p>العدسات&nbsp;مبيعا&nbsp;حول&nbsp;العالم&nbsp;تتميز&nbsp;عدسات&nbsp;أكيوفيو&nbsp;اويسيس&nbsp;بــــ&nbsp;&bull;&nbsp;تحمى&nbsp;عينيك&nbsp;من&nbsp;الاشاعة&nbsp;</p>\r\n\r\n<p>الفوق&nbsp;بنفسجية&nbsp;تكنولوجيا&nbsp;الهيدرا&nbsp;كلير&nbsp;بلس&nbsp;تجعل&nbsp;عينيك&nbsp;رطبة&nbsp;طول&nbsp;اليوم&nbsp;&bull;&nbsp;</p>\r\n\r\n<p>يزيل&nbsp;أي&nbsp;تراكم&nbsp;قد&nbsp;يسبب&nbsp;تهيجًا&nbsp;في&nbsp;عينيك&nbsp;Smartshield</p>', NULL, 'عدسات   أكيوفيو أويسيس هيدرا كلير بلس الاسبوعية  من جونسون عدسات لاصقة شفافة', 'العدسات اللاصقة الاسبوعية من جونسون عدسات اكيو فيو  هيدراكلير بلس الاسبوعية  \r\n تسوق الان من موقع QEYEQ .COM   اول متجر لبيع العدسات الشفافة والملونة فى مصر والسعودية', NULL),
(13, '2019-11-22 13:02:40', '2019-11-30 07:19:22', NULL, 7, 1, 'ACUVUE OASYS ONE DAY HYDRALUXE PACK 30&90', '<p>Acuvue&nbsp;Oasys&nbsp;1-Day&nbsp;with&nbsp;HydraLuxe&trade;&nbsp;contact&nbsp;lenses,&nbsp;from&nbsp;healthcare&nbsp;specialists&nbsp;Johnson&nbsp;&amp;&nbsp;Johnson,&nbsp;are&nbsp;daily&nbsp;disposable&nbsp;lenses&nbsp;that&nbsp;use&nbsp;advanced&nbsp;technology&nbsp;for&nbsp;a&nbsp;truly&nbsp;comfortable&nbsp;wearing&nbsp;experience.</p>', NULL, 'Buy now online  OASYS  1-Day   QeyeQ', 'Daily contact lenses from Johnson\r\nShop now from QEYEQ .COM the first store to sell colored and transparent lenses in Egypt and Saudi Arabia', 'Acuvue Daily, Acuvue, Johnson Lenses, Daily Lenses, Oasis Lenses, Colored Lenses, Eye Lenses,, Lenses For Sale, Natural Lenses Daily Medical Lenses, Colored Medical Lenses, Prescription Lenses, Medical Lenses, Transparent, Low Vision Lenses, Chinese Lenses, Lenses Monthly, transparent lenses, annual lenses, lenses, cyan, medical consultations, the way of wearing lenses for beginners with pictures, Toric lenses, the best types of lenses, how to, the use of contact lenses, the best lenses for glasses, optical lenses, colored lenses, lenses,, myopia Medical, contact lenses, eye contact lenses, eye lenses ,, permanent eye lenses, eye lenses, contact lenses'),
