(15, '2019-11-22 15:21:34', '2019-11-24 09:32:03', NULL, 8, 1, 'ACUVUE MOIST ASTIGMATISM ONE DAY', '<p>1&nbsp;Day&nbsp;ACUVUE&reg;&nbsp;MOIST&reg;&nbsp;FOR&nbsp;ASTIGMATISM&nbsp;contact&nbsp;lenses&nbsp;are&nbsp;designed&nbsp;to&nbsp;correct&nbsp;astigmatism&nbsp;whilst&nbsp;offering&nbsp;the&nbsp;comfort&nbsp;of&nbsp;a&nbsp;daily&nbsp;disposable&nbsp;lens.&nbsp;Your&nbsp;eyes&nbsp;will&nbsp;remain&nbsp;moist,&nbsp;fresh&nbsp;and&nbsp;comfortable&nbsp;with&nbsp;this&nbsp;daily&nbsp;toric&nbsp;lens,&nbsp;enjoy&nbsp;crisp&nbsp;and&nbsp;clear&nbsp;vision&nbsp;all&nbsp;day&nbsp;long.&nbsp;LACREON&nbsp;technology&nbsp;ensures&nbsp;moisture&nbsp;stays&nbsp;embedded&nbsp;within&nbsp;the&nbsp;lens,&nbsp;so&nbsp;it&nbsp;won&#39;t&nbsp;rub&nbsp;away.</p>', NULL, 'ACUVUE MOIST ASTIGMATISM ONE DAY', NULL, NULL),
(16, '2019-11-22 15:21:34', '2019-11-24 09:32:03', NULL, 8, 2, 'أكيو فيو مويست  وان داى استجماتزم', '<p>وان&nbsp;داى&nbsp;اكيوفيو&nbsp;للمرضى&nbsp;الذين&nbsp;يعانون&nbsp;من&nbsp;انحراف&nbsp;النظر&nbsp;والتى&nbsp;تساعد&nbsp;فى&nbsp;الحفاظ&nbsp;على&nbsp;الرؤية&nbsp;الواضحة&nbsp;والمستقرة&nbsp;طول&nbsp;اليوم&nbsp;تصميمها&nbsp;الفريد&nbsp;الذى&nbsp;يتميز&nbsp;بادخال&nbsp;اعلى&nbsp;نسبة&nbsp;من&nbsp;الاكسجين&nbsp;داخل&nbsp;العين&nbsp;ممايذيد&nbsp;من&nbsp;ترطيب&nbsp;العدسة</p>', NULL, 'وان داى اكيوفيو عدسات لمعالجة انحراف النظر استجماتزم', NULL, NULL),
(17, '2019-11-22 15:46:52', '2019-11-24 09:32:37', NULL, 9, 1, 'ACUVUE OASYS FOR ASTIGMATISM', '<p>Acuvue&nbsp;Oasys&nbsp;for&nbsp;Astigmatism&nbsp;are&nbsp;high&nbsp;quality&nbsp;toric&nbsp;contact&nbsp;lenses&nbsp;made&nbsp;by&nbsp;Johnson&nbsp;&amp;&nbsp;Johnson&nbsp;These&nbsp;lenses&nbsp;are&nbsp;designed&nbsp;to&nbsp;provide&nbsp;a&nbsp;high&nbsp;level&nbsp;of&nbsp;comfort&nbsp;throughout&nbsp;the&nbsp;day,&nbsp;with&nbsp;unique&nbsp;Hydraclear&nbsp;Plus&nbsp;Technology&nbsp;for&nbsp;an&nbsp;ultra-smooth&nbsp;lens&nbsp;surface&nbsp;that&nbsp;keeps&nbsp;your&nbsp;vision&nbsp;fresh&nbsp;and&nbsp;clear.&nbsp;The&nbsp;Accelerated&nbsp;Stabilisation&nbsp;Design&nbsp;ensures&nbsp;that&nbsp;your&nbsp;vision&nbsp;stays&nbsp;clear&nbsp;and&nbsp;stable&nbsp;throughout&nbsp;the&nbsp;day,&nbsp;no&nbsp;matter&nbsp;how&nbsp;active&nbsp;your&nbsp;routine&nbsp;might&nbsp;be.</p>', NULL, 'ACUVUE OASYS  for ASTIGMATISM Contact Lenses', 'Unique Accelerated Stabilisation Design™ (ASD) technology delivers clear and stable vision regardless of head or eye movements. \r\nACUVUE OASYS®, are the no.1 selling contact lenses brand in the world3,', NULL),
(18, '2019-11-22 15:46:52', '2019-11-24 09:32:37', NULL, 9, 2, 'أكيوفيو أويسيس أستجماتزم', '<p>عدسات&nbsp;أكيوفيو&nbsp;اويسيس&nbsp;استجماتيزم&nbsp;هي&nbsp;عدسات&nbsp;لاصقة&nbsp;ذات&nbsp;جودة&nbsp;عالية&nbsp;مصنوعة&nbsp;من&nbsp;قبل&nbsp;شركة&nbsp;جونسون&nbsp;اند&nbsp;جونسون&nbsp;تم&nbsp;تصميم&nbsp;هذه&nbsp;العدسات&nbsp;لتوفير&nbsp;مستوى&nbsp;عالٍ&nbsp;من&nbsp;الراحة&nbsp;على&nbsp;مدار&nbsp;اليوم&nbsp;،&nbsp;مع&nbsp;تقنية&nbsp;Hydraclear&nbsp;Plus&nbsp;الفريدة&nbsp;لسطح&nbsp;العدسة&nbsp;فائقة&nbsp;النعومة&nbsp;الذي&nbsp;يبقي&nbsp;رؤيتك&nbsp;جديدة&nbsp;وواضحة.&nbsp;يضمن&nbsp;تصميم&nbsp;العدسات&nbsp;لبقاء&nbsp;رؤيتك&nbsp;واضحة&nbsp;ومستقرة&nbsp;على&nbsp;مدار&nbsp;اليوم&nbsp;،&nbsp;بغض&nbsp;النظر&nbsp;عن&nbsp;مدى&nbsp;روتينك&nbsp;النشط.</p>', NULL, 'عدسات اكيوفيو اويسيس عدسات لعلاج انحراف النظر', 'هي العلامة التجارية الأولى لبيع العدسات اللاصقة في العالم 3 ، حيث توفر  العدسة تغطية غير مسبوقة من الاستجماتزم  راحة طويلة الامد مع اكيوفيو اويسيس\r\nرؤية واضحة ومستقرة بغض النظر عن حركة الرأس اوالعين', NULL),
(19, '2019-11-22 16:13:47', '2019-11-24 09:35:10', NULL, 10, 1, 'AIR OPTIX FOR ASTIGMAISM', '<p>Air&nbsp;Optix&nbsp;for&nbsp;Astigmatism&nbsp;contact&nbsp;lenses,&nbsp;from&nbsp;Ciba&nbsp;Vision,&nbsp;are&nbsp;toric&nbsp;monthly&nbsp;lenses&nbsp;ideal&nbsp;for&nbsp;those&nbsp;with&nbsp;astigmatism&nbsp;who&nbsp;need&nbsp;to&nbsp;wear&nbsp;their&nbsp;lenses&nbsp;for&nbsp;most&nbsp;of&nbsp;the&nbsp;day.&nbsp;These&nbsp;ultra-breathable&nbsp;lenses&nbsp;make&nbsp;use&nbsp;of&nbsp;Ciba&nbsp;Vision&rsquo;s&nbsp;TriComfort&trade;&nbsp;Technology&nbsp;for&nbsp;a&nbsp;healthy,&nbsp;natural&nbsp;feeling&nbsp;and&nbsp;comfort&nbsp;all&nbsp;day&nbsp;for&nbsp;up&nbsp;to&nbsp;30&nbsp;consecutive&nbsp;days.&nbsp;This&nbsp;technology&nbsp;allows&nbsp;more&nbsp;oxygen&nbsp;to&nbsp;flow&nbsp;continuously&nbsp;through&nbsp;the&nbsp;lens,&nbsp;retains&nbsp;moisture&nbsp;and&nbsp;ensures&nbsp;a&nbsp;smooth&nbsp;lens&nbsp;surface</p>', NULL, 'AIR OPTIX FOR ASTIGMAISM', NULL, NULL),
(20, '2019-11-22 16:13:47', '2019-11-24 09:35:10', NULL, 10, 2, 'أير اوبتكـــس استجماتزم', '<p>أير&nbsp;اوبنكـــس&nbsp;عدسات&nbsp;شهرية&nbsp;مثالية&nbsp;للذين&nbsp;يعانون&nbsp;من&nbsp;الاستجماتيزم&nbsp;الذين&nbsp;يحتاجون&nbsp;إلى&nbsp;ارتداء&nbsp;عدساتهم&nbsp;لمعظم&nbsp;اليوم.&nbsp;تستخدم&nbsp;هذه&nbsp;العدسات&nbsp;فائقة&nbsp;التحمل&nbsp;تقنية&nbsp;TriComfort&nbsp;&trade;&nbsp;من&nbsp;Ciba&nbsp;Vision&nbsp;للحصول&nbsp;على&nbsp;شعور&nbsp;صحي&nbsp;طبيعي&nbsp;وراحة&nbsp;طوال&nbsp;اليوم&nbsp;لمدة&nbsp;تصل&nbsp;إلى&nbsp;30&nbsp;يومًا&nbsp;متتاليًا.&nbsp;تتيح&nbsp;هذه&nbsp;التقنية&nbsp;تدفق&nbsp;المزيد&nbsp;من&nbsp;الأوكسجين&nbsp;بشكل&nbsp;مستمر&nbsp;عبر&nbsp;العدسة&nbsp;،&nbsp;والاحتفاظ&nbsp;بالرطوبة&nbsp;وضمان&nbsp;سطح&nbsp;المس&nbsp;للعدسة</p>', NULL, 'أير اوبتكـــس استجماتزم', NULL, NULL),
(21, '2019-11-23 09:17:34', '2019-11-28 12:21:24', NULL, 11, 1, 'DAILIES AQYA COMFORT PLUS TORIC', '<p>Dailies&nbsp;AquaComfort&nbsp;Plus&nbsp;Toric&nbsp;are&nbsp;designed&nbsp;specifically&nbsp;to&nbsp;be&nbsp;worn&nbsp;by&nbsp;astigmatism&nbsp;patients,&nbsp;and&nbsp;so&nbsp;are&nbsp;of&nbsp;an&nbsp;elongated&nbsp;shape&nbsp;that&nbsp;ensures&nbsp;consistently&nbsp;clear&nbsp;vision.&nbsp;They&nbsp;also&nbsp;make&nbsp;use&nbsp;of&nbsp;Alcon&rsquo;s&nbsp;Lightstream&nbsp;Technology&trade;&nbsp;for&nbsp;a&nbsp;lens&nbsp;surface&nbsp;that&nbsp;is&nbsp;perfectly&nbsp;smooth&nbsp;and&nbsp;sits&nbsp;on&nbsp;your&nbsp;eye&nbsp;securely&nbsp;and&nbsp;comfortably.&nbsp;Blink-activated&nbsp;technology&nbsp;also&nbsp;causes&nbsp;moisture&nbsp;to&nbsp;be&nbsp;slowly&nbsp;released&nbsp;into&nbsp;the&nbsp;eye&nbsp;with&nbsp;each&nbsp;blink,&nbsp;keeping&nbsp;your&nbsp;eyes&nbsp;feeling&nbsp;fresh&nbsp;and&nbsp;hydrated&nbsp;all&nbsp;day.</p>', NULL, 'DAILIES AquaComfort Plus Toric', NULL, NULL),
(22, '2019-11-23 09:17:34', '2019-11-28 12:21:24', NULL, 11, 2, 'ديليـــز أكوا كمفورت بلـس استجماتزم', '<p>ديايــز&nbsp;أكوا&nbsp;كمفورت&nbsp;عدسات&nbsp;يومية&nbsp;تم&nbsp;تصميم&nbsp;خصيصًا&nbsp;ليتم&nbsp;ارتداؤها&nbsp;من&nbsp;قِبل&nbsp;مرضى&nbsp;الأستجماتيزم&nbsp;،&nbsp;تضمن&nbsp;رؤية&nbsp;واضحة&nbsp;باستمرار.&nbsp;كما&nbsp;أنها&nbsp;تستفيد&nbsp;من&nbsp;تقنية&nbsp;&trade;&nbsp;Alcon&nbsp;Lightstream&nbsp;للحصول&nbsp;على&nbsp;سطح&nbsp;عدسة&nbsp;ناعم&nbsp;تمامًا&nbsp;ويجلس&nbsp;على&nbsp;عينيك&nbsp;بشكل&nbsp;آمن&nbsp;ومريح.&nbsp;تتسبب&nbsp;تقنية&nbsp;Lightstream&nbsp;أيضًا&nbsp;في&nbsp;إطلاق&nbsp;الرطوبة&nbsp;ببطء&nbsp;في&nbsp;العين&nbsp;،&nbsp;مما&nbsp;يجعل&nbsp;عينيك&nbsp;تشعران&nbsp;بالانتعاش&nbsp;والرطوبة&nbsp;طوال&nbsp;اليوم</p>', NULL, 'ديليـــز أكوا كمفورت بلـس استجماتزم', NULL, NULL),
(23, '2019-11-23 09:38:33', '2019-11-28 10:58:42', NULL, 12, 1, 'ACUVUE  2 PACK OF 6', '<p>Acuvue&nbsp;2&nbsp;contact&nbsp;lenses,&nbsp;from&nbsp;Johnson&nbsp;&amp;&nbsp;Johnson,&nbsp;are&nbsp;easy-to-use&nbsp;and&nbsp;comfortable&nbsp;two-weekly&nbsp;lenses,&nbsp;perfect&nbsp;for&nbsp;first&nbsp;time&nbsp;or&nbsp;new&nbsp;wearers.&nbsp;These&nbsp;lenses&nbsp;can&nbsp;be&nbsp;worn&nbsp;for&nbsp;14&nbsp;consecutive&nbsp;days,&nbsp;and&nbsp;some&nbsp;opticians&nbsp;may&nbsp;even&nbsp;recommend&nbsp;them&nbsp;for&nbsp;extended&nbsp;wear.&nbsp;Acuvue&nbsp;2&nbsp;allow&nbsp;up&nbsp;to&nbsp;88%&nbsp;of&nbsp;oxygen&nbsp;to&nbsp;reach&nbsp;your&nbsp;eye&nbsp;while&nbsp;you&rsquo;re&nbsp;wearing&nbsp;them,&nbsp;meaning&nbsp;that&nbsp;your&nbsp;eyes&nbsp;will&nbsp;stay&nbsp;white&nbsp;and&nbsp;comfortable&nbsp;throughout&nbsp;the&nbsp;day.</p>', NULL, 'ACUVUE  2', NULL, NULL),
(24, '2019-11-23 09:38:33', '2019-11-28 10:58:42', NULL, 12, 2, 'أكيو فيو 2', '<p>أكيوفيو&nbsp;2&nbsp;هي&nbsp;عدسات&nbsp;سهلة&nbsp;الاستخدام&nbsp;ومريحة&nbsp;لمدة&nbsp;أسبوعين&nbsp;،&nbsp;وهي&nbsp;مثالية&nbsp;لأستخدام&nbsp;الأول&nbsp;أو&nbsp;مرتديها&nbsp;الجدد.&nbsp;يمكن&nbsp;ارتداء&nbsp;هذه&nbsp;العدسات&nbsp;لمدة&nbsp;14&nbsp;يومًا&nbsp;متتاليًا&nbsp;،&nbsp;وقد&nbsp;يوصي&nbsp;بها&nbsp;بعض&nbsp;أخصائيي&nbsp;البصريات&nbsp;ارتداءها&nbsp;لفترة&nbsp;اطول&nbsp;تسمح&nbsp;العدسات&nbsp;بوصول&nbsp;88٪&nbsp;من&nbsp;الأكسجين&nbsp;الى&nbsp;عينيك&nbsp;أثناء&nbsp;ارتداءها&nbsp;،&nbsp;مما&nbsp;يعني&nbsp;راحة&nbsp;عينيك&nbsp;طوال&nbsp;اليوم.</p>', NULL, 'أكيو فيو 2', NULL, NULL),
(25, '2019-11-23 10:02:11', '2019-11-28 09:54:25', NULL, 13, 1, 'AIR OPTIX PLUS HYDRAGLYDE', '<p>Air&nbsp;Optix&nbsp;plus&nbsp;HydraGlyde&reg;&nbsp;contact&nbsp;lenses,&nbsp;from&nbsp;leading&nbsp;manufacturer&nbsp;Alcon,&nbsp;are&nbsp;monthly&nbsp;lenses&nbsp;that&nbsp;utilise&nbsp;advanced&nbsp;technology&nbsp;for&nbsp;an&nbsp;ultra-comfortable&nbsp;wearing&nbsp;experience.&nbsp;The&nbsp;HydraGlyde&nbsp;&reg;&nbsp;Moisture&nbsp;Matrix&nbsp;helps&nbsp;the&nbsp;lens&nbsp;surface&nbsp;to&nbsp;retain&nbsp;water&nbsp;using&nbsp;a&nbsp;thin,&nbsp;protective&nbsp;layer&nbsp;of&nbsp;moisture.&nbsp;This&nbsp;keeps&nbsp;your&nbsp;eyes&nbsp;hydrated&nbsp;throughout&nbsp;the&nbsp;day&nbsp;and&nbsp;makes&nbsp;them&nbsp;a&nbsp;suitable&nbsp;lens&nbsp;for&nbsp;those&nbsp;that&nbsp;suffer&nbsp;from&nbsp;dry&nbsp;eyes,&nbsp;as&nbsp;well&nbsp;as&nbsp;those&nbsp;who&nbsp;wear&nbsp;lenses&nbsp;for&nbsp;sport.</p>', NULL, 'QeyeQ  Buy Now  AIR OPTIX  plus HydraGlyde-6', 'Air Optix Contact lenses \r\nBuy now from our online store Q eye Q', NULL),
(26, '2019-11-23 10:02:11', '2019-11-28 09:54:25', NULL, 13, 2, 'أير أوبتكــس بلـس هيدراغليد', '<p>عدسات&nbsp;أير&nbsp;اوبتكس&nbsp;بلس&nbsp;هيدراغليد&nbsp;هي&nbsp;عدسات&nbsp;شهرية&nbsp;تستخدم&nbsp;تكنولوجيا&nbsp;متقدمة&nbsp;لتجربة&nbsp;ارتداء&nbsp;مريحة&nbsp;للغاية.&nbsp;تساعد&nbsp;تقنية&nbsp;HydraGlyde&nbsp;&reg;&nbsp;على&nbsp;الاحتفاظ&nbsp;بالماء&nbsp;باستخدام&nbsp;طبقة&nbsp;رقيقة&nbsp;واقية&nbsp;من&nbsp;الرطوبة.&nbsp;هذا&nbsp;يبقي&nbsp;عينيك&nbsp;رطبة&nbsp;طوال&nbsp;اليوم&nbsp;ويجعلها&nbsp;عدسة&nbsp;مناسبة&nbsp;لأولئك&nbsp;الذين&nbsp;يعانون&nbsp;من&nbsp;جفاف&nbsp;العين&nbsp;،&nbsp;وكذلك&nbsp;أولئك&nbsp;الذين&nbsp;يرتدون&nbsp;العدسات&nbsp;للرياضة.</p>', NULL, 'عدسات اير اوبتكس الشفافة  توصيل الرياض نفس اليوم مجانا', 'عدسات شهرية عالية الجودة -من اير اوبتكس\r\nاشترى الان موقع كيو اى  كيو  توصيل مجانى داخل الرياض', NULL),
(27, '2019-11-23 10:44:03', '2019-11-28 10:09:07', NULL, 14, 1, 'BIOTRUE ONE DAY PACK 30&90', '<p>Biotrue&nbsp;ONEday&nbsp;contact&nbsp;lenses,&nbsp;manufactured&nbsp;by&nbsp;Bausch&nbsp;&amp;&nbsp;Lomb,&nbsp;are&nbsp;daily&nbsp;disposable&nbsp;lenses&nbsp;made&nbsp;from&nbsp;a&nbsp;unique&nbsp;material&nbsp;called&nbsp;hypergel.&nbsp;The&nbsp;design&nbsp;of&nbsp;these&nbsp;lenses&nbsp;was&nbsp;inspired&nbsp;by&nbsp;the&nbsp;biology&nbsp;of&nbsp;the&nbsp;human&nbsp;eye&nbsp;and&nbsp;they&nbsp;aim&nbsp;to&nbsp;mimic&nbsp;the&nbsp;surface&nbsp;of&nbsp;your&nbsp;eyes&nbsp;to&nbsp;provide&nbsp;you&nbsp;with&nbsp;outstanding&nbsp;comfort&nbsp;that&nbsp;lasts&nbsp;all&nbsp;day.</p>', NULL, 'Biotrue ONEday', NULL, NULL),
(28, '2019-11-23 10:44:03', '2019-11-28 10:09:07', NULL, 14, 2, 'بايـــــوتــرو وان داى', '<p>بايو&nbsp;ترو&nbsp;العدسات&nbsp;اللاصقة&nbsp;،&nbsp;المصنعة&nbsp;من&nbsp;قبل&nbsp;بوش&nbsp;اند&nbsp;لومب&nbsp;،&nbsp;هي&nbsp;العدسات&nbsp;المتاح&nbsp;يوميا&nbsp;مصنوعة&nbsp;من&nbsp;مادة&nbsp;فريدة&nbsp;تسمى&nbsp;hypergel.&nbsp;تصميم&nbsp;هذه&nbsp;العدسات&nbsp;مستوحى&nbsp;من&nbsp;بيولوجيا&nbsp;العين&nbsp;البشرية&nbsp;وتهدف&nbsp;إلى&nbsp;تقليد&nbsp;سطح&nbsp;عينيك&nbsp;لتوفر&nbsp;لك&nbsp;راحة&nbsp;رائعة&nbsp;تدوم&nbsp;طوال&nbsp;اليوم.&nbsp;بالإضافة&nbsp;إلى&nbsp;الشعور&nbsp;بالراحة&nbsp;،&nbsp;توفر&nbsp;بايو&nbsp;ترو&nbsp;جودة&nbsp;عالية&nbsp;ورؤية&nbsp;واضحة&nbsp;،&nbsp;مما&nbsp;يقلل&nbsp;من&nbsp;أي&nbsp;هالات&nbsp;وهج&nbsp;التي&nbsp;تواجهها&nbsp;العدسات&nbsp;اللاصقة&nbsp;الأخرى&nbsp;أيضًا&nbsp;تحمى&nbsp;من&nbsp;للأشعة&nbsp;فوق&nbsp;البنفسجية&nbsp;يوفر&nbsp;لعينيك&nbsp;طبقة&nbsp;إضافية&nbsp;من&nbsp;الحماية&nbsp;ضد&nbsp;أضرار&nbsp;أشعة&nbsp;الشمس&nbsp;المحتملة&nbsp;،&nbsp;مما&nbsp;يجعلها&nbsp;اختيارًا&nbsp;ممتازًا&nbsp;لأولئك&nbsp;الذين&nbsp;يأخذون&nbsp;صحة&nbsp;العين&nbsp;بجدية.</p>', NULL, 'بايو ترو العدسة يومية', NULL, NULL),
(29, '2019-11-23 11:01:27', '2019-11-28 08:19:13', NULL, 15, 1, 'DAILIES TOTAL ONE PACk 30&90', '<p>Dailies&nbsp;Total&nbsp;1&nbsp;are&nbsp;daily&nbsp;disposable&nbsp;contact&nbsp;lenses&nbsp;manufactured&nbsp;by&nbsp;vision&nbsp;experts&nbsp;Ciba&nbsp;Vision.&nbsp;As&nbsp;a&nbsp;water&nbsp;gradient&nbsp;lens,&nbsp;they&nbsp;offer&nbsp;unparalleled&nbsp;comfort&nbsp;that&nbsp;remains&nbsp;at&nbsp;a&nbsp;consistently&nbsp;high&nbsp;level&nbsp;for&nbsp;the&nbsp;entire&nbsp;day.&nbsp;The&nbsp;surface&nbsp;of&nbsp;the&nbsp;lens&nbsp;has&nbsp;a&nbsp;water&nbsp;content&nbsp;of&nbsp;nearly&nbsp;80%,&nbsp;keeping&nbsp;your&nbsp;eyes&nbsp;completely&nbsp;moisturised&nbsp;and&nbsp;hydrated&nbsp;while&nbsp;you&rsquo;re&nbsp;wearing&nbsp;them.</p>', NULL, 'DAILIES TOTAL ONE', NULL, NULL),
