(32, '2019-11-23 12:49:33', '2019-11-28 08:23:09', NULL, 16, 2, 'ديلــــيز أكوا كمفورت  بلس', '<p>ديليز&nbsp;اكواكمفورت&nbsp;بلس&nbsp;عدسات&nbsp;عالية&nbsp;الجودة&nbsp;.&nbsp;تمنع&nbsp;عينيك&nbsp;من&nbsp;الجفاف&nbsp;لمدة&nbsp;تصل&nbsp;إلى&nbsp;12&nbsp;ساعة&nbsp;في&nbsp;اليوم&nbsp;،&nbsp;حتى&nbsp;في&nbsp;البيئات&nbsp;المكيفة&nbsp;أو&nbsp;الساخنة.&nbsp;عندما&nbsp;تقترن&nbsp;بالتصميم&nbsp;الرفيع&nbsp;جدًا&nbsp;لكل&nbsp;عدسة&nbsp;،&nbsp;فهذه&nbsp;التكنولوجيا&nbsp;هي&nbsp;التي&nbsp;تجعل&nbsp;Aquacomfort&nbsp;Plus&nbsp;مريحًا&nbsp;جدًا&nbsp;وسهل&nbsp;الارتداء.&nbsp;تستخدم&nbsp;تقنية&nbsp;Lightstream&nbsp;الفريدة&nbsp;لتجميع&nbsp;كل&nbsp;عدسة&nbsp;،&nbsp;بحيث&nbsp;يمكنك&nbsp;التأكد&nbsp;من&nbsp;أداء&nbsp;ثابت&nbsp;مع&nbsp;كل&nbsp;عدسة.&nbsp;هذا&nbsp;يعني&nbsp;أنه&nbsp;يمكنك&nbsp;التخلص&nbsp;من&nbsp;العدسات&nbsp;القديمة&nbsp;كل&nbsp;ليلة&nbsp;والتطلع&nbsp;إلى&nbsp;رؤية&nbsp;واضحة&nbsp;وجديدة&nbsp;كل&nbsp;صباح.</p>', NULL, 'ديلــــيز أكوا كمفورت  بلس', NULL, 'عدسات ديليز ,عدسات ديليز اليومية,عدسات اكوافيو ,اكوافيو بلس,عدسات شفافة ,عدسات طبية ,عدسات طبية نظر ,عدسات الكون ,عدسات يومية شفافة ,عدسات نظر,عدسات بالرياض ,عدسات جونسون ,افضل ماركات العدسات'),
(33, '2019-11-23 13:07:49', '2019-11-28 08:56:02', NULL, 17, 1, 'ACUVUE MOIST ONE DAY PACK 30&90', '<p>1&nbsp;Day&nbsp;Acuvue&nbsp;Moist&nbsp;are&nbsp;ultra&nbsp;comfortable&nbsp;daily&nbsp;contact&nbsp;lenses&nbsp;from&nbsp;Johnson&nbsp;&amp;&nbsp;Johnson.&nbsp;If&nbsp;you&#39;re&nbsp;looking&nbsp;for&nbsp;lenses&nbsp;that&nbsp;can&nbsp;provide&nbsp;long&nbsp;lasting&nbsp;comfort,&nbsp;1&nbsp;Day&nbsp;Acuvue&nbsp;Moist&nbsp;are&nbsp;a&nbsp;great&nbsp;choice.&nbsp;Their&nbsp;unique&nbsp;moisture&nbsp;cushion&nbsp;keeps&nbsp;your&nbsp;eyes&nbsp;free&nbsp;from&nbsp;irritation&nbsp;and&nbsp;is&nbsp;specially&nbsp;formulated&nbsp;to&nbsp;provide&nbsp;extra&nbsp;care.&nbsp;They&nbsp;have&nbsp;a&nbsp;high&nbsp;water&nbsp;content&nbsp;of&nbsp;58%&nbsp;and&nbsp;are&nbsp;made&nbsp;from&nbsp;ultra&nbsp;breathable&nbsp;etafilcon&nbsp;A,&nbsp;so&nbsp;it&#39;s&nbsp;no&nbsp;surprise&nbsp;they&nbsp;are&nbsp;a&nbsp;super&nbsp;popular&nbsp;daily&nbsp;contact&nbsp;lens.</p>', NULL, 'ACUVUE MOIST ONE DAY', NULL, NULL),
