(43, '2019-11-23 18:11:33', '2019-11-23 18:21:44', NULL, 22, 1, 'FREHLOOK COLORBLENDS ONE DAY', '<p>FreshLook&nbsp;One&nbsp;Day&nbsp;contact&nbsp;lenses,&nbsp;from&nbsp;leading&nbsp;optical&nbsp;specialists&nbsp;Ciba&nbsp;Vision,&nbsp;are&nbsp;daily&nbsp;coloured&nbsp;contact&nbsp;lenses&nbsp;that&nbsp;offer&nbsp;a&nbsp;range&nbsp;of&nbsp;shades&nbsp;to&nbsp;complement&nbsp;and&nbsp;enhance&nbsp;your&nbsp;natural&nbsp;eye&nbsp;colour.&nbsp;These&nbsp;daily&nbsp;disposable&nbsp;coloured&nbsp;contact&nbsp;lenses&nbsp;are&nbsp;available&nbsp;for&nbsp;both&nbsp;cosmetic&nbsp;or&nbsp;prescription&nbsp;use,&nbsp;simply&nbsp;select&nbsp;your&nbsp;tint&nbsp;and&nbsp;then,&nbsp;if&nbsp;you&nbsp;don&rsquo;t&nbsp;need&nbsp;sight&nbsp;correction,&nbsp;select&nbsp;0.00&nbsp;as&nbsp;your&nbsp;power.</p>', NULL, 'FREHLOOK COLORBLENDS ONE DAY', NULL, NULL),
