(47, '2019-11-25 07:30:54', '2019-12-07 18:15:15', NULL, 24, 1, 'ANESTHESIA ANESTHATIC', '<p><strong>Anesthesia&nbsp;is&nbsp;characterized&nbsp;by&nbsp;many&nbsp;very&nbsp;soft&nbsp;colors&nbsp;that&nbsp;show&nbsp;aesthetic&nbsp;touch&nbsp;and&nbsp;natural&nbsp;eye&nbsp;effect.These&nbsp;lenses&nbsp;redefine&nbsp;the&nbsp;hydrogen&nbsp;bond&nbsp;between&nbsp;water&nbsp;and&nbsp;lens&nbsp;material&nbsp;and&nbsp;thus&nbsp;maintain&nbsp;maximum&nbsp;moisture&nbsp;throughout&nbsp;the&nbsp;duration&nbsp;of&nbsp;use.&nbsp;Suitable&nbsp;for&nbsp;those&nbsp;who&nbsp;suffer&nbsp;from&nbsp;dehydration&nbsp;and&nbsp;discomfort&nbsp;with&nbsp;other&nbsp;lenses&nbsp;</strong></p>\r\n\r\n<p><strong>Enjoy&nbsp;a&nbsp;sense&nbsp;of&nbsp;luxury&nbsp;and&nbsp;comfort&nbsp;and&nbsp;change&nbsp;in&nbsp;eye&nbsp;color&nbsp;with&nbsp;Anastasia&nbsp;for&nbsp;up&nbsp;to&nbsp;6&nbsp;months</strong></p>\r\n\r\n<p><strong>Choose&nbsp;the&nbsp;right&nbsp;color&nbsp;and&nbsp;size&nbsp;if&nbsp;you&nbsp;are&nbsp;looking&nbsp;for&nbsp;a&nbsp;vision&nbsp;correction</strong></p>\r\n\r\n<p><strong>&nbsp;&nbsp;Free&nbsp;solution&nbsp;with&nbsp;lens</strong></p>', NULL, 'ANESTHESIA ANESTHATIC', 'Anesthesia', 'Colored lenses, Zeina lenses, medical lenses, Tri-color, Tri-color gray, gray, green, lenses, Lenz, Linzes, eye lenses, wedding lenses, Lens Mai, Nora Bou Awad, Bella lenses, Lens Mai lenses, Professor, Bella. Slutica, Makeup, Fashion, Bella Contour, Pilanatural, Bella Glow, Slutica, Slutica Lenses, Slutica Addict Lenses, Gray Slutica, Eyeglasses, Anesthesia, Anastasia Lenses\', Anastasia Dream, Anastasia Instatic'),
