(100, '2019-12-24 05:35:24', '2019-12-24 05:50:23', NULL, 53, 2, 'سوفلنس 59 عبوة من 6 عدسات', '<p>&nbsp;</p>\r\n\r\n<p><span dir=\"RTL\">سوفلنـس&nbsp;59&nbsp;العدسات&nbsp;اللاصقـة&nbsp;الشهرية&nbsp;.&nbsp;المصنعة&nbsp;من&nbsp;بوش&nbsp;اند&nbsp;لومب</span></p>\r\n\r\n<p><span dir=\"RTL\">العدسات&nbsp;الشهرية:&nbsp;يمكن&nbsp;ارتداؤها&nbsp;لمدة&nbsp;30&nbsp;يومًا&nbsp;متتالية</span></p>\r\n\r\n<p><span dir=\"RTL\">سطح&nbsp;عدسة&nbsp;مقاوم&nbsp;للبروتين&nbsp;يمنع&nbsp;الترسبات&nbsp;والتراكم</span></p>\r\n\r\n<p><span dir=\"RTL\">نسبة&nbsp;عالية&nbsp;من&nbsp;الماء&nbsp;لعينين&nbsp;مميّتين&nbsp;وخاليتين&nbsp;من&nbsp;التهيج</span></p>\r\n\r\n<p><span dir=\"RTL\">ارتداء&nbsp;مريح&nbsp;حتى&nbsp;خلال&nbsp;المهام&nbsp;التي&nbsp;يمكن&nbsp;أن&nbsp;تسبب&nbsp;إجهاد&nbsp;العين</span></p>\r\n\r\n<p><span dir=\"RTL\">ضمان&nbsp;شعور&nbsp;جديد&nbsp;ومريح&nbsp;وكذلك&nbsp;رؤية&nbsp;&nbsp;واضح&nbsp;تماما</span></p>', NULL, 'سوفلنس كومفورت', 'سوفلنـس 59 العدسات اللاصقـة الشهرية\r\nتوصيل فورى لاول مرة بمصر  اشترى عدساتك الان اصلية مضمونة   الدفع عند الاستلام من كيوى اى كيو \r\nWWW.QEYEQ.COM', 'عدسات نظر,عدسات,عدسات بوش اند لومب ,عدسات مصر,عدسات سوفلنس ,بوش اند لومب,عدسات كمفورت'),
(101, '2019-12-24 06:09:07', '2019-12-24 06:35:10', NULL, 54, 1, 'SOLOTYCA NATURAL', '<p>SOLOTICA&nbsp;Natural&nbsp;All&nbsp;Natural&nbsp;is&nbsp;a&nbsp;soft&nbsp;natural&nbsp;color&nbsp;that&nbsp;shows&nbsp;a&nbsp;touch&nbsp;of&nbsp;beauty&nbsp;and&nbsp;a&nbsp;natural&nbsp;eye&nbsp;effect&nbsp;9&nbsp;colors,&nbsp;lot&nbsp;of&nbsp;beauty&nbsp;options,&nbsp;a&nbsp;great&nbsp;look&nbsp;and&nbsp;a&nbsp;one&nbsp;year&nbsp;vision&nbsp;Choose&nbsp;the&nbsp;right&nbsp;color&nbsp;and&nbsp;size&nbsp;if&nbsp;you&nbsp;are&nbsp;looking&nbsp;for&nbsp;a&nbsp;vision&nbsp;correction&nbsp;Free&nbsp;solution&nbsp;with&nbsp;lens</p>', NULL, 'SOLOTYCA NATURAL', NULL, NULL),
(102, '2019-12-24 06:09:07', '2019-12-24 06:35:10', NULL, 54, 2, 'سلوتيكا ناتشورال', '<p>سلوتيــكا&nbsp;ناتشورال&nbsp;ألــون&nbsp;طبيعية&nbsp;ناعمة&nbsp;تظهر&nbsp;لمسة&nbsp;جمالــية&nbsp;وتأثير&nbsp;طبيعـى&nbsp;للعـين&nbsp;فى&nbsp;9&nbsp;ألــوان&nbsp;توفر&nbsp;الكثير&nbsp;من&nbsp;خيارات&nbsp;الجمال&nbsp;والمظهر&nbsp;الرائع&nbsp;ورؤية&nbsp;فـائقة&nbsp;الوضوح&nbsp;لمدة&nbsp;عام&nbsp;أختـــارى&nbsp;اللـون&nbsp;المناسب&nbsp;والمقاس&nbsp;الخاص&nbsp;بك&nbsp;إن&nbsp;كنتى&nbsp;تبحثين&nbsp;عن&nbsp;مقاس&nbsp;لتصحيح&nbsp;النظر&nbsp;عبوة&nbsp;محلول&nbsp;مجانا&nbsp;مع&nbsp;كل&nbsp;عدسة</p>', NULL, 'سلوتيكا ناتشورال', NULL, NULL);
